from tkinter import Tk, Label
from PIL import Image, ImageTk
import io
from base64 import b64decode

IMG_WIDTH = 1280
IMG_HEIGHT = 720

image_data = ""

image_data = b64decode(image_data)

logo_data = ""
logo_data = b64decode(logo_data)

with open("output_image.png", "wb") as f:
    f.write(image_data)

# Alternatively if you prefer using PIL:
image = Image.open(io.BytesIO(image_data))
image.save("output_image.png")

r, g, b, a = image.split()
r.show()
g.show()
b.show()
a.show()

root = Tk()
root.geometry(f"{IMG_WIDTH}x{IMG_HEIGHT}")
root.resizable(False, False)
root.title("Lydia's New Code")
icon = ImageTk.PhotoImage(Image.open(io.BytesIO(logo_data)))
root.wm_iconphoto(False, icon)
image = Image.open(io.BytesIO(image_data))
image = image.resize((IMG_WIDTH, IMG_HEIGHT))
photo_image = ImageTk.PhotoImage(image)
label = Label(image=photo_image)
label.image = photo_image
label.place(x=0, y=0)
root.mainloop()


